import React from 'react';
import { Link } from 'react-router-dom';

const CompBackBtn = () => {
  return (
    <Link to="/" className="back-btn">
      <i class="fa-solid fa-arrow-right-from-bracket"></i>
    </Link>
  );
};

export default CompBackBtn;
